ConstValues.value:
"(function() {
    window.cmpToSDK_sendStatus = function(consent, jsonObject) {
        jsonObject.cmpString = consent;
        window.webkit.messageHandlers.consent.postMessage(jsonObject);
    };

    window.cmpToSDK_showConsentLayer = function(open) {
        window.webkit.messageHandlers.open.postMessage(open);
    };

    window.onerror = function(error) {
        window.webkit.messageHandlers.error.postMessage(error.toString());
    };

    return null;
})();"
